import { NativeRouter } from "react-router-native";
import Main from "./src/Main";
import * as Font from "expo-font";
import { useState } from "react";

export default function App() {
  const [fontsLoaded, setFontsLoaded] = useState(false);
  return (
    <NativeRouter>
      <Main />
    </NativeRouter>
  );
}
